import React from "react";
import ContentLoader from "react-content-loader";

const ImageSkeleton = () => (
  <ContentLoader
    speed={2}
    width={50}
    height={50}
    viewBox="0 0 40 1200"
    backgroundColor="#c0c0c0"
    foregroundColor="#ecebeb"
  >
    <circle cx="60" cy="25" r="25" />
  </ContentLoader>
);
export default ImageSkeleton;
